import './App.css';
import React, { useRef } from 'react';
import { MapContainer, LayerGroup, Circle } from 'react-leaflet'
import Maps from './components/Maps';
import Markers from './components/Markers';
import Button from './components/Button';

const App = () => {
  const CustomControl = ({ position }) => {
    const buttonRef = useRef(null);

    return (
      <div
        ref={buttonRef}
        style={{
          position: 'absolute',
          top: position[0],
          left: position[1],
          zIndex: 1000
        }}
      >
        <Button />
      </div>
    );
  };

  return (
    <div>
      <MapContainer center={[44.119370, 15.231365]} zoom={13} scrollWheelZoom={true}>
        <Maps />
        <Markers />
        <CustomControl position={[10, 10]} />
      </MapContainer>

    </div >

  )
}

export default App;
